" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 574px\">",
"   <div class=\"ttl\">",
"    Intraosseous cannulation technique",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 554px; height: 631px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) Insert the needle in the proximal tibia on the flat surface located distal and medial to the tibial tuberosity. Direct the needle caudad (away from growth plate) at a 10 to 15 degree angle. Use downward pressure from the heel of the hand, and a twisting motion until resistance decreases. See text for details.",
"    <br>",
"     (B) Marrow can sometimes be aspirated.",
"     <br>",
"      (C) The needle will flush easily when it is in the marrow cavity and should stand without support.",
"      <br>",
"       Once successful placement is established, immobilize the leg and secure the needle.",
