var title_f38_17_39192="Immunohistol kidney Alport";
var content_f38_17_39192=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F81373&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F81373&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 608px\">",
"   <div class=\"ttl\">",
"    Immunohistological analysis of the renal distribution of type IV collagen chains",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 588px; height: 295px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The analysis was carried out in (",
"    <strong>",
"     A-D",
"    </strong>",
"    ) control, X-linked (",
"    <strong>",
"     E,F",
"    </strong>",
"    ) male and (",
"    <strong>",
"     G,H",
"    </strong>",
"    ) female Alport syndrome patients, and (",
"    <strong>",
"     I-L",
"    </strong>",
"    ) patients with autosomal recessive Alport syndrome, using antibodies to &alpha;1(IV) (",
"    <strong>",
"     A,E,I",
"    </strong>",
"    ), &alpha;3(IV) (",
"    <strong>",
"     B,F,J",
"    </strong>",
"    ), or &alpha;5(IV) (",
"    <strong>",
"     C,G,K,L",
"    </strong>",
"    ) chains. Double labeling was made with anti-&alpha;2(IV) in red, and anti-&alpha;5(IV) in green (",
"    <strong>",
"     D,H",
"    </strong>",
"    ). In control kidney, the &alpha;1(IV) chain is present in the mesangial matrix, Bowman's capsule, and the extraglomerular basement membranes (",
"    <strong>",
"     A",
"    </strong>",
"    ). The &alpha;3(IV) and &alpha;5(IV) chains are distributed within the GBM (",
"    <strong>",
"     B",
"    </strong>",
"    and",
"    <strong>",
"     C",
"    </strong>",
"    , respectively). The Bowman's capsule is strongly &alpha;5(IV)-positive (",
"    <strong>",
"     C",
"    </strong>",
"    ). In X-linked Alport syndrome, no &alpha;3(IV) expression was detected in a male patient (id for &alpha;4-&alpha;5) (",
"    <strong>",
"     F",
"    </strong>",
"    ), whereas the distribution is segmental in a female patient (",
"    <strong>",
"     G",
"    </strong>",
"    ). In autosomal recessive Alport syndrome, no &alpha;3(IV)-&alpha;5(IV) labeling is detected in the GBM (",
"    <strong>",
"     J",
"    </strong>",
"    ) whereas &alpha;5(IV) is expressed in Bowman's capsule (",
"    <strong>",
"     K",
"    </strong>",
"    ) and the basement membranes of the collecting ducts (",
"    <strong>",
"     L",
"    </strong>",
"    ). In both types of Alport syndrome, &alpha;1(IV) is diffusely expressed in the GBM (",
"    <strong>",
"     E,I",
"    </strong>",
"    ).",
"    <div class=\"footnotes\">",
"     GBM: glomerular basement membrane.",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from: Gubler MC. Inherited diseases of the glomerular basement membrane. Nat Clin Pract Nephrol 2008; 1:24. Copyright &copy;2008 Macmillan Publishers Ltd.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
