" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Secondary involvement of the central nervous system by non-Hodgkin lymphoma",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?38/17/39194/contributors\">",
"     Authors",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?38/17/39194/contributors\">",
"     Andrew D Norden, MD",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?38/17/39194/contributors\">",
"     Ephraim Hochberg, MD",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?38/17/39194/contributors\">",
"     Fred H Hochberg, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?38/17/39194/contributors\">",
"     Section Editor",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?38/17/39194/contributors\">",
"     Arnold S Freedman, MD",
"    </a>",
"    <br/>",
"   </div>",
