var title_f38_17_39195="Relative contraindications to exercise testing";
var content_f38_17_39195=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F56030&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F56030&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Relative contraindications to exercise testing*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Severe arterial hypertension (ie, diastolic blood pressure &gt;110 mmHg or systolic blood pressure &gt;200 mmHg at rest)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Left main coronary stenosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Moderate stenotic valvular heart disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Electrolyte abnormalities (hypokalemia, hypomagnesemia)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        High degree atrioventricular block",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tachyarrhythmias or bradyarrhythmias",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypertrophic cardiomyopathy or other forms of outflow tract obstruction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ventricular aneurysm",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Uncontrolled metabolic disease (eg, diabetes, thyrotoxicosis, or myxedema)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chronic infectious disease (eg, mononucleosis, hepatitis, AIDS)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mental or physical impairment leading to inability to exercise adequately",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neuromuscular, musculoskeletal, or rheumatoid disorders that are exacerbated by exercise",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Relative contraindications can be superceded if benefits outweigh risks of exercise. In some instances, these individuals can be exercised with caution and/or using low-level end points, especially if they are asymptomatic at rest.",
"    </div>",
"    <div class=\"reference\">",
"     Modified from: Gibbons RJ, Balady GJ, Bricker JT, et al. ACC/AHA 2002 guideline update for exercise testing: summary article: a report of the American College of Cardiology/American Heart Association Task Force on Practice Guidelines (Committee to Update the 1997 Exercise Testing Guidelines). Circulation 2002; 106:1883.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
